INSERT INTO "JEECGBOOT"."ONL_CGFORM_ENHANCE_JS" VALUES ('a0ca1d842f138ba2cda00bc44e95edd9', 'loaded(){
  this.$nextTick(()=>{
    let text = ''测试js增强设置默认值'';
    if(this.isUpdate.value === true){
      text = ''测试js增强修改表单值'';
    }
    this.setFieldsValue({
      name: text
    })
  })
}

 onlChange(){
   return {
    name(){
      let value = event.value
      let values = {''dhwb'': ''我的名称是：''+ value }
      this.triggleChangeValues(values)
    }
  }
 }

beforeSubmit(row){
	return new Promise((resolve, reject)=>{
    //此处模拟等待时间，可能需要发起请求
    setTimeout(()=>{
      if(row.name == ''test''){
        // 当某个字段不满足要求的时候可以reject 
        reject(''不能提交测试数据'');
      }else{
        resolve();
      }
    },3000)
  })
}', 'form', NULL, '553a4172fde446419cb602dc70f9ee67');
