-- ----------------------------
DROP TABLE "JEECGBOOT"."SYS_ANNOUNCEMENT";
CREATE TABLE "JEECGBOOT"."SYS_ANNOUNCEMENT" (
  "ID" NVARCHAR2(32) NOT NULL,
  "TITILE" NVARCHAR2(100),
  "MSG_CONTENT" NCLOB,
  "START_TIME" DATE,
  "END_TIME" DATE,
  "SENDER" NVARCHAR2(100),
  "PRIORITY" NVARCHAR2(255),
  "MSG_CATEGORY" NVARCHAR2(10) NOT NULL,
  "MSG_TYPE" NVARCHAR2(10),
  "SEND_STATUS" NVARCHAR2(10),
  "SEND_TIME" DATE,
  "CANCEL_TIME" DATE,
  "DEL_FLAG" NVARCHAR2(1),
  "BUS_TYPE" NVARCHAR2(20),
  "BUS_ID" NVARCHAR2(50),
  "OPEN_TYPE" NVARCHAR2(20),
  "OPEN_PAGE" NVARCHAR2(255),
  "CREATE_BY" NVARCHAR2(32),
  "CREATE_TIME" DATE,
  "UPDATE_BY" NVARCHAR2(32),
  "UPDATE_TIME" DATE,
  "USER_IDS" NCLOB,
  "MSG_ABSTRACT" NCLOB,
  "DT_TASK_ID" NVARCHAR2(100)
)
LOGGING
NOCOMPRESS
PCTFREE 10
INITRANS 1
STORAGE (
  INITIAL 65536 
  NEXT 1048576 
  MINEXTENTS 1
  MAXEXTENTS 2147483645
  BUFFER_POOL DEFAULT
)
PARALLEL 1
NOCACHE
DISABLE ROW MOVEMENT
;
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."TITILE" IS '标题';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."MSG_CONTENT" IS '内容';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."START_TIME" IS '开始时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."END_TIME" IS '结束时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."SENDER" IS '发布人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."PRIORITY" IS '优先级（L低，M中，H高）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."MSG_CATEGORY" IS '消息类型1:通知公告2:系统消息';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."MSG_TYPE" IS '通告对象类型（USER:指定用户，ALL:全体用户）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."SEND_STATUS" IS '发布状态（0未发布，1已发布，2已撤销）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."SEND_TIME" IS '发布时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."CANCEL_TIME" IS '撤销时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."DEL_FLAG" IS '删除状态（0，正常，1已删除）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."BUS_TYPE" IS '业务类型(email:邮件 bpm:流程)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."BUS_ID" IS '业务id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."OPEN_TYPE" IS '打开方式(组件：component 路由：url)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."OPEN_PAGE" IS '组件/路由 地址';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."USER_IDS" IS '指定用户';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."MSG_ABSTRACT" IS '摘要';
COMMENT ON COLUMN "JEECGBOOT"."SYS_ANNOUNCEMENT"."DT_TASK_ID" IS '钉钉task_id，用于撤回消息';
COMMENT ON TABLE "JEECGBOOT"."SYS_ANNOUNCEMENT" IS '系统通告表';

