-- Table structure for SYS_FILES
-- ----------------------------
DROP TABLE "JEECGBOOT"."SYS_FILES";
CREATE TABLE "JEECGBOOT"."SYS_FILES" (
  "ID" NVARCHAR2(32) NOT NULL,
  "FILE_NAME" NVARCHAR2(255),
  "URL" NVARCHAR2(1000),
  "FILE_TYPE" NVARCHAR2(20),
  "STORE_TYPE" NVARCHAR2(20),
  "PARENT_ID" NVARCHAR2(32),
  "TENANT_ID" NVARCHAR2(100),
  "FILE_SIZE" NUMBER(13,2),
  "IZ_FOLDER" NVARCHAR2(2),
  "IZ_ROOT_FOLDER" NVARCHAR2(2),
  "IZ_STAR" NVARCHAR2(2),
  "DOWN_COUNT" NUMBER(11,0),
  "READ_COUNT" NUMBER(11,0),
  "SHARE_URL" NVARCHAR2(255),
  "SHARE_PERMS" NVARCHAR2(2),
  "ENABLE_DOWN" NVARCHAR2(2),
  "ENABLE_UPDAT" NVARCHAR2(2),
  "DEL_FLAG" NVARCHAR2(2),
  "CREATE_BY" NVARCHAR2(32),
  "CREATE_TIME" DATE,
  "UPDATE_BY" NVARCHAR2(32),
  "UPDATE_TIME" DATE
)
LOGGING
NOCOMPRESS
PCTFREE 10
INITRANS 1
STORAGE (
  INITIAL 65536 
  NEXT 1048576 
  MINEXTENTS 1
  MAXEXTENTS 2147483645
  BUFFER_POOL DEFAULT
)
PARALLEL 1
NOCACHE
DISABLE ROW MOVEMENT
;
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."ID" IS '主键id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."FILE_NAME" IS '文件名称';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."URL" IS '文件地址';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."FILE_TYPE" IS '文档类型（folder:文件夹 excel:excel doc:word ppt:ppt image:图片  archive:其他文档 video:视频 pdf:pdf）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."STORE_TYPE" IS '文件上传类型(temp/本地上传(临时文件) manage/知识库)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."PARENT_ID" IS '父级id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."TENANT_ID" IS '租户id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."FILE_SIZE" IS '文件大小（kb）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."IZ_FOLDER" IS '是否文件夹(1：是  0：否)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."IZ_ROOT_FOLDER" IS '是否为1级文件夹，允许为空 (1：是 )';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."IZ_STAR" IS '是否标星(1：是  0：否)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."DOWN_COUNT" IS '下载次数';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."READ_COUNT" IS '阅读次数';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."SHARE_URL" IS '分享链接';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."SHARE_PERMS" IS '分享权限(1.关闭分享 2.允许所有联系人查看 3.允许任何人查看)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."ENABLE_DOWN" IS '是否允许下载(1：是  0：否)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."ENABLE_UPDAT" IS '是否允许修改(1：是  0：否)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."DEL_FLAG" IS '删除状态(0-正常,1-删除至回收站)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."CREATE_BY" IS '创建人登录名称';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."CREATE_TIME" IS '创建日期';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."UPDATE_BY" IS '更新人登录名称';
COMMENT ON COLUMN "JEECGBOOT"."SYS_FILES"."UPDATE_TIME" IS '更新日期';
COMMENT ON TABLE "JEECGBOOT"."SYS_FILES" IS '知识库-文档管理';

