-- ----------------------------
-- Table structure for SYS_PERMISSION
-- ----------------------------
DROP TABLE "JEECGBOOT"."SYS_PERMISSION";
CREATE TABLE "JEECGBOOT"."SYS_PERMISSION" (
  "ID" NVARCHAR2(32) NOT NULL,
  "PARENT_ID" NVARCHAR2(32),
  "NAME" NVARCHAR2(100),
  "URL" NVARCHAR2(255),
  "COMPONENT" NVARCHAR2(255),
  "COMPONENT_NAME" NVARCHAR2(100),
  "REDIRECT" NVARCHAR2(255),
  "MENU_TYPE" NUMBER(11,0),
  "PERMS" NVARCHAR2(255),
  "PERMS_TYPE" NVARCHAR2(10),
  "SORT_NO" NUMBER(8,2),
  "ALWAYS_SHOW" NUMBER(4,0),
  "ICON" NVARCHAR2(100),
  "IS_ROUTE" NUMBER(4,0),
  "IS_LEAF" NUMBER(4,0),
  "KEEP_ALIVE" NUMBER(4,0),
  "HIDDEN" NUMBER(4,0),
  "HIDE_TAB" NUMBER(4,0),
  "DESCRIPTION" NVARCHAR2(255),
  "CREATE_BY" NVARCHAR2(32),
  "CREATE_TIME" DATE,
  "UPDATE_BY" NVARCHAR2(32),
  "UPDATE_TIME" DATE,
  "DEL_FLAG" NUMBER(11,0),
  "RULE_FLAG" NUMBER(11,0),
  "STATUS" NVARCHAR2(2),
  "INTERNAL_OR_EXTERNAL" NUMBER(4,0)
)
LOGGING
NOCOMPRESS
PCTFREE 10
INITRANS 1
STORAGE (
  INITIAL 65536 
  NEXT 1048576 
  MINEXTENTS 1
  MAXEXTENTS 2147483645
  BUFFER_POOL DEFAULT
)
PARALLEL 1
NOCACHE
DISABLE ROW MOVEMENT
;
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."ID" IS '主键id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."PARENT_ID" IS '父id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."NAME" IS '菜单标题';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."URL" IS '路径';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."COMPONENT" IS '组件';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."COMPONENT_NAME" IS '组件名字';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."REDIRECT" IS '一级菜单跳转地址';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."MENU_TYPE" IS '菜单类型(0:一级菜单; 1:子菜单:2:按钮权限)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."PERMS" IS '菜单权限编码';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."PERMS_TYPE" IS '权限策略1显示2禁用';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."SORT_NO" IS '菜单排序';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."ALWAYS_SHOW" IS '聚合子路由: 1是0否';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."ICON" IS '菜单图标';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."IS_ROUTE" IS '是否路由菜单: 0:不是  1:是（默认值1）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."IS_LEAF" IS '是否叶子节点:    1:是   0:不是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."KEEP_ALIVE" IS '是否缓存该页面:    1:是   0:不是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."HIDDEN" IS '是否隐藏路由: 0否,1是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."HIDE_TAB" IS '是否隐藏tab: 0否,1是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."DESCRIPTION" IS '描述';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."DEL_FLAG" IS '删除状态 0正常 1已删除';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."RULE_FLAG" IS '是否添加数据权限1是0否';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."STATUS" IS '按钮权限状态(0无效1有效)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION"."INTERNAL_OR_EXTERNAL" IS '外链菜单打开方式 0/内部打开 1/外部打开';
COMMENT ON TABLE "JEECGBOOT"."SYS_PERMISSION" IS '菜单权限表';

