COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."ID" IS '主键id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."PARENT_ID" IS '父id';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."NAME" IS '菜单标题';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."URL" IS '路径';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."COMPONENT" IS '组件';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."IS_ROUTE" IS '是否路由菜单: 0:不是  1:是（默认值1）';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."COMPONENT_NAME" IS '组件名字';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."REDIRECT" IS '一级菜单跳转地址';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."MENU_TYPE" IS '菜单类型(0:一级菜单; 1:子菜单:2:按钮权限)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."PERMS" IS '菜单权限编码';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."PERMS_TYPE" IS '权限策略1显示2禁用';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."SORT_NO" IS '菜单排序';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."ALWAYS_SHOW" IS '聚合子路由: 1是0否';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."ICON" IS '菜单图标';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."IS_LEAF" IS '是否叶子节点:    1是0否';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."KEEP_ALIVE" IS '是否缓存该页面:    1:是   0:不是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."HIDDEN" IS '是否隐藏路由: 0否,1是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."HIDE_TAB" IS '是否隐藏tab: 0否,1是';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."DESCRIPTION" IS '描述';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."CREATE_BY" IS '创建人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."CREATE_TIME" IS '创建时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."UPDATE_BY" IS '更新人';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."UPDATE_TIME" IS '更新时间';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."DEL_FLAG" IS '删除状态 0正常 1已删除';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."RULE_FLAG" IS '是否添加数据权限1是0否';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."STATUS" IS '按钮权限状态(0无效1有效)';
COMMENT ON COLUMN "JEECGBOOT"."SYS_PERMISSION_V3"."INTERNAL_OR_EXTERNAL" IS '外链菜单打开方式 0/内部打开 1/外部打开';
COMMENT ON TABLE "JEECGBOOT"."SYS_PERMISSION_V3" IS '菜单权限表';

